import API from "../api/axios";

async function handleLogin(e) {
  e.preventDefault();

  try {
    const res = await API.post("/auth/login", {
      email,
      password,
    });

    console.log("LOGIN SUCCESS:", res.data);
    alert("Logged in!");

  } catch (err) {
    console.log("LOGIN ERROR:", err);
    alert("Login failed");
  }
}
